import { Transform } from "./Transform"

export const Components = (props) => {
  return <div
    style={{
      margin: 12
    }}
  >
    <h2>GameObject</h2>
    <div
      style={{
        cursor: `pointer`
      }}
      onClick={() => {
        const { name, old, object } = props
        window.editor.setNameInput([name, (newText) => {
          if(name === newText) {
            return
          }

          if(old[newText]) {
            console.error(`Error`)
          } else {
            delete old[name]
            old[newText] = object
            window.editor.reloadHierarchy()
          }
        }])
      }}
    >
      {props.name}
    </div>
    <Transform {...props} />
  </div>
}
